import React, { useEffect, useState } from 'react'
import LoginButton from './components/LoginButton'
import LogoutButton from './components/LogoutButton'
import { useAuth0 } from '@auth0/auth0-react'
import { Listbox } from '@headlessui/react'

export default function App() {
  const {user} = useAuth0();
  const [organization, setOrganization] = useState();
  const [email, setEmail] = useState();
  const [organizations, setOrganizations] = useState();

  useEffect(() => {
    if (organizations) {
      setOrganization(organizations[0]);
    }
  }, [organizations]);

  const getOrgs = () => {
    fetch('http://localhost:8080/user-orgs-by-email?email=' + email)
    .then(response => response.json())
    .then(data => setOrganizations(data));
  }

  const handleSubmit = (evt) => {
    evt.preventDefault();
    getOrgs();
}

  return (
    <div style={{width:"200px", margin:"0 auto"}}>
      <h1>Team 0</h1>
      {!user && 
        <>
          <form onSubmit={handleSubmit}>
            <label>
              Email
              <input
                type="text"
                value={email}
                onChange={e => setEmail(e.target.value)}
              />
            </label>
            <input type="submit" value="Submit" />
          </form>
        </>
      }
      {organizations && organization &&
        <>
        <LoginButton organization={organization.id} email={email}/>
          <Listbox value={organization} onChange={setOrganization}>
            {({ open }) => (
              <>
                <Listbox.Label className="block text-sm font-medium text-gray-700">Team:</Listbox.Label>
                <div className="mt-1 relative">
                  <Listbox.Button className="relative w-full bg-white border border-gray-300 rounded-md shadow-sm pl-3 pr-10 py-2 text-left cursor-default focus:outline-none focus:ring-1 focus:ring-indigo-500 focus:border-indigo-500 sm:text-sm">
                    <span className="flex items-center">
                      <img src={organization.branding.logo_url} alt="" className="flex-shrink-0 h-6 w-6 rounded-full" />
                      <span className="ml-3 block truncate">{organization.display_name}</span>
                    </span>
                    <span className="ml-3 absolute inset-y-0 right-0 flex items-center pr-2 pointer-events-none">
                      <SelectorIcon className="h-5 w-5 text-gray-400" aria-hidden="true" />
                    </span>
                  </Listbox.Button>

                  <Transition
                    show={open}
                    as={Fragment}
                    leave="transition ease-in duration-100"
                    leaveFrom="opacity-100"
                    leaveTo="opacity-0"
                  >
                    <Listbox.Options className="absolute z-10 mt-1 w-full bg-white shadow-lg max-h-56 rounded-md py-1 text-base ring-1 ring-black ring-opacity-5 overflow-auto focus:outline-none sm:text-sm">
                      {organizations.map((org) => (
                        <Listbox.Option
                          key={org.id}
                          className={({ active }) =>
                            classNames(
                              active ? 'text-white bg-indigo-600' : 'text-gray-900',
                              'cursor-default select-none relative py-2 pl-3 pr-9'
                            )
                          }
                          value={org}
                        >
                          {({ selected, active }) => (
                            <>
                              <div className="flex items-center">
                                <img src={org.branding.logo_url} alt="" className="flex-shrink-0 h-6 w-6 rounded-full" />
                                <span
                                  className={classNames(selected ? 'font-semibold' : 'font-normal', 'ml-3 block truncate')}
                                >
                                  {org.display_name}
                                </span>
                              </div>

                              {selected ? (
                                <span
                                  className={classNames(
                                    active ? 'text-white' : 'text-indigo-600',
                                    'absolute inset-y-0 right-0 flex items-center pr-4'
                                  )}
                                >
                                  <CheckIcon className="h-5 w-5" aria-hidden="true" />
                                </span>
                              ) : null}
                            </>
                          )}
                        </Listbox.Option>
                      ))}
                    </Listbox.Options>
                  </Transition>
                </div>
              </>
            )}
          </Listbox>

          {/* <Listbox value={organization} onChange={setOrganization}>
            <Listbox.Button>{organization.display_name}</Listbox.Button>
            <Listbox.Options>
              {organizations.map((org) => (
                <Listbox.Option
                  key={org.id}
                  value={org}
                >
                  {org.display_name}
                </Listbox.Option>
              ))}
            </Listbox.Options>
          </Listbox> */}
        </>
      }
      {user &&
        <>
          <LogoutButton />
          <thead>
            <tr>
              <th>First Name</th>
              <th>Email</th>
              <th>Org</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>{user.nickname}</td>
              <td>{user.email}</td>
              <td>{user.org_id}</td>
            </tr>
          </tbody>
        </>
      }
    </div>
  )
}
